import React from "react";
class Header extends React.Component{
  render(){
      return(
          <div>
              
              <nav class="navbar navbar-inverse">
                  <a class="navbar-brand" href="#">Title</a>
                  <ul class="nav navbar-nav">
                      <li class="active">
                          <a href="#">Home</a>
                      </li>
                      <li>
                          <a href="#">Product</a>
                      </li>
                  </ul>
              </nav>
              
              
          </div>
      );
  }
}
export default Header;
